function Start()

	-- Spawn Lilith phase 2 actor using a spawn power.
	local idSpawnLoc = Hydra.ActorsInGroup("Lilith_Boss_Spawn")[1]
	local S_SUMMON_POWER = Hydra.ReferencePower("Lilith_p2_boss_spawn");
	local snoPowerSummon = Hydra.PowerSNOFromName(S_SUMMON_POWER);
	local idLilithPhase2 = Hydra.ActorSpawnActor("Lilith_p2_Boss", idSpawnLoc, false, 0, 0, Hydra.MR_BOSS, snoPowerSummon, false)
	Hydra.ActorAddToBossEncounter(idLilithPhase2);
	
	-- Enable boss camera, so that the camera yaws towards Lilith.
	Hydra.ActorSetUseBossCamera(idLilithPhase2, true);

	-- Make Lilith untargetable until she fully emerge from blood pool. (The buff is from the power: Lilith_p1_Boss_HeartCrucible)
	Hydra.BuffApplyToTarget(LILITH_INVULNERABLE, "UNTARGETABLE", idLilithPhase2);

	-- Remove untargetable buff (The buff is from the power: Lilith_p1_Boss_HeartCrucible)
	Hydra.Wait(8);
	Hydra.BuffRemove(LILITH_INVULNERABLE, "UNTARGETABLE", idLilithPhase2);

	-- Remove camera yaw, so the camera is centered on the player 
	Hydra.Wait(6);
	
	Hydra.ActorSetBossCameraOverride(idLilithPhase2, "observer_lilith_p2_boss_stage_1");
	Hydra.ActorSetBossCameraFollowsPlayer(idLilithPhase2, true)

end
